function Header() {
    return (
        <header>
            <nav className="nav">
                <img src="github-mark.png" className="nav-logo"/>
                <ul className="nav-list">
                    <li>Our GitHub Repo</li>
                </ul>
            </nav>
        </header>
    )
};

export default Header
